import React from "react";
import ToggleSlider from "./ToggleSlider";

function Main() {
    function handleToggleChange() {
        console.log("Toggle is clicked");
    }

    return (
        <div>
            <h2>Main Component</h2>
            <ToggleSlider onChange={handleToggleChange} />
        </div>
    );
}

export default Main;
